:8:"owner_id";i:1940946660;}i:140;a:1:{s:14:"owner_username";s:0:"";}i:141;a:1:{s:14:"owner_fullname";s:0:"";}i:142;a:1:{s:9:"owner_pic";s:0:"";}i:143;a:1:{s:2:"id";s:19:"2391124467632933271";}i:144;a:1:{s:10:"short_code";s:11:"CEu-wjbAYmX";}i:145;a:1:{s:12:"created_time";i:1599264270;}i:146;a:1:{s:7:"caption";s:2149:"Disney History! ‚ú® I added this pin onto a black tie in Walt‚Äôs Office as a little detail that maybe not everyone will know about. It‚Äôs the subtle details that I like to add that makes the room just a little more magical. 

Here‚Äôs the history ‚ú®

If you look carefully at the Partners statue of Walt and Mickey, you‚Äôll notice the letters ‚ÄúSTR‚Äù intertwined together on his tie. Those aren‚Äôt the initials of a person, but of a place, one that Walt especially loved.

The 375 acre Smoke Tree Ranch, in the Mojave Desert just outside of Palm Springs, California, was Walt‚Äôs hideaway, where he would go with Lilly and the family to relax. 

An accomplished horseman, Walt enjoyed the ranch life. He‚Äôd often spend hours at Smoke Tree in the morning riding through the desert playing cowboy, before returning in the afternoon to freshen up for some lawn bowling (an activity he excelled at) and then answering the communal dinner bell at night before closing out the evening on the backyard patio in a hammock gazing at the star lit sky.

Walt built his first home at Smoke Tree Ranch in 1948. It broke his heart to sell it in 1954, but he needed the money to help build Disneyland. In 1956, he built another home there. It stayed in Disney family hands even after his death in 1966. 

On his Disneyland and Wonderful World TV shows, Walt often wore the brand ‚ÄúSTR‚Äù - which was and still is the logo for the dude ranch - on his ties. It was his quiet happy little wink to his favorite spot on Earth (besides his theme park and studio, of course.) 

